import styled from '@emotion/styled';
import Top3 from './Top3';
import Top4 from './Top4';

const ImgContainer = styled.div`
  width: 100%;
  position: relative;
`;

const Img = styled.img`
  width: 100%;
  height: auto;

  object-fit: cover;
`;

const DescribeBlock = styled.div``;

const Title = styled.div`
  font-size: 20px;
  font-weight: bold;
`;

const ModalContent = ({
  carImage,
  carClassName,
  maker,
  carModel,
  fuel,
  gearbox,
  capacity,
  safetyOption,
  additionalOption,
}) => {
  return (
    <>
      <ImgContainer>
        <Img src={carImage} alt={`${carClassName} 차량`} />
      </ImgContainer>
      <Title>{carClassName}</Title>
      <Top4>제조사 : {maker}</Top4>
      <Top4>분류 : {carModel}</Top4>
      <Top4>연료 : {fuel}</Top4>
      <Top4>변속방식 : {gearbox}</Top4>
      <Top4>승차정원 : {capacity}</Top4>
      <Top3>안전 옵션</Top3>
      <Top4>{safetyOption}</Top4>
      <Top3>편의 옵션</Top3>
      <Top4>{additionalOption}</Top4>
    </>
  );
};

export default ModalContent;
